import {Component, OnInit} from '@angular/core';
import {Doctor} from "../services/doctor";
import {DoctorService} from "../services/doctor.service";
import {HttpErrorResponse} from "@angular/common/http";
import {ProfessionService} from "../services/profession.service";
import {Profession} from "../services/profession";
import {error} from "@angular/compiler-cli/src/transformers/util";

@Component({
  selector: 'app-doctors',
  templateUrl: './doctors.component.html',
  styleUrls: ['./doctors.component.css']
})
export class DoctorsComponent implements OnInit{
  //public doctors: Doctor[];
  //public professions: Profession[] | undefined;

  private newProfessionList: any;
  public selected: string = "";

  constructor(private _doctorService: DoctorService,
              private _professionService: ProfessionService,
              public _professions: Profession[],
              public _doctors: Doctor[]){
    this._doctorService = _doctorService;
    this._professionService = _professionService;
    this._professions = _professions;
    this._doctors = _doctors;
  }

  ngOnInit(){
    this.getDoctors();
    this.getAllProfessions();
  }
  public clickOnSeeMoreButton(doctor: Doctor): void{

  }
  public clickOnSearchButton():void {
    /*
      for(let prof of this.professions){
        if(this.selected == prof.name)
          this.newProfessionList.push(prof);
      }

     */
  }

  public getDoctors(): void {
    this._doctorService.getDoctors().subscribe(
      (response: Doctor[]) => {
        this._doctors = response;
        },
      (error: HttpErrorResponse) => {
        alert(error.message);
      }
      )
  }

  public getAllProfessions(): void {
    this._professionService.getProfession().subscribe(
      (response: Profession[]) => {
        this._professions = response;
      },
      (error: HttpErrorResponse) => {
        alert(error.message);
      }
    )
  }
}
